import React from 'react';
import { Nav, Navbar, Container } from 'react-bootstrap';
import { NavLink } from 'react-router-dom';
import './Navigation.css'; // Import the CSS file

function Navigation() {
  return (
    <Navbar collapseOnSelect expand="lg" bg="dark" variant="dark">
      <Container>
        <Navbar.Brand href="/">Brandon Wing</Navbar.Brand>
        <Navbar.Toggle aria-controls="responsive-navbar-nav" />
        <Navbar.Collapse id="responsive-navbar-nav">
          <Nav className="me-auto">
            <Nav.Link as={NavLink} to="/about" activeClassName="active-link">About Me</Nav.Link>
            <Nav.Link as={NavLink} to="/portfolio" activeClassName="active-link">Portfolio</Nav.Link>
            <Nav.Link as={NavLink} to="/contact" activeClassName="active-link">Contact</Nav.Link>
            <Nav.Link as={NavLink} to="/resume" activeClassName="active-link">Resume</Nav.Link>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
}

export default Navigation;
